import {BEGIN_GET_USERDATA, 
        GET_USERDATA_OK, 
        GET_USERDATA_ERROR
} from '../types/index';

export function getUserDataAction(data){

    return(dispatch) =>{

            dispatch( getuserData() )
            try {   

                dispatch( getUserDataOk(data) )
                
            } catch (error) {
                console.log(error);
            }
    }
}
const getuserData = () => ({

    type: BEGIN_GET_USERDATA
})
const getUserDataOk = (data) => ({

    type: GET_USERDATA_OK,
    payload: data

})
